import React from "react";
import { StyleSheet } from "react-native";

export const style = StyleSheet.create({
    content: {
        width: '60vw',
        height: '50vh',
        marginTop: '1rem',
        marginRight: '1rem',
        backgroundColor: 'black',
        display: 'flex',
        flexDirection: 'column',
        gap: '1rem',
        border: '2px gray'
    }
})
